text:
{'text': 'The cafe is tucked away on the outside of the building (Poiz centre), facing the main road. There is indoor as well as outdoor seating available.

The menu is limited but they do what they serve well. The food and drinks were delicious. I recommend all the food we ordered, especially the Patty melt. The hot chicken sandwich came in a very substantial portion and was extra crispy and yummy with the coleslaw.

Bonus: The Staff is friendly and they provide quick and warm service, eventhough the cafe was about 80% full when we went.', 'languageCode': 'en'}

